import React, { Component } from "react";

export default class Counter extends Component {
  state = {
    count: 0,
  };
  render() {
    return (
      <React.Fragment>
        <span>{this.state.count}</span>
        <button className="btn btn-success">Submit</button>
      </React.Fragment>
    );
  }

  formatCount() {
      return this.state.count == 0
  }
}
